import React, {Component} from 'react';
// import css
import "../css/App.css"
import "../css/index.css"

// import js function
import { GitIcon, LogoTop } from './Header';
import { OnSubmit } from './SubmitButton';
import { main } from './Params';

// import image file
import search from "../assets/icon/logo.svg"

// import Footer from "./Footer/Footer";
// import Header from "./Header/Header";

export default class Home extends Component{
    render() {
    return (
        <div className="App">
            <div className='Header'>
                <LogoTop id="logo-header"/>
                <GitIcon/>
            </div>
            <div className='Body'>
                <h1 className='HomeTitle'>
                    <img src={search} className='App-logo' alt='search'/>
                    Web<span>2</span>sum
                </h1>
                <div className='In-Line'>
                    <input className='Search-Box' 
                    id="input-box"
                    onChange={()=>this.handleChange()}
                    onClick={()=>this.handleOnClick()}
                    defaultValue={main.defautText}
                    onPointerLeave={()=>this.handleReset()}
                    onPointerEnter={()=>this.handleOnStay()}/>
                    <OnSubmit/>
                </div>
                    <div id="dashboard" className='Start-lvl'>
                        <div id='webScrap' className='Rectangle' style={{height: "50vh"}}/>
                        <div id='summarize' className='Rectangle' style={{height: "35vh"}}/>
                    </div>
            </div>
        </div>
    )
  }
}
